Like new Taurus 24/7 Pro compact. 3.5" barrel. Has a safety lock & key built in the slide. This weapon has been fired 100 times. No mis fires or hang ups.
Comes with a 11 round mag, and a 15 round mag, A FOBUS SP 11 B holster;
a INSIGHT X2 laser light combo. Trigger lock. It has the "Ribber" grip which really feels good in the hand.
